DROP TABLE qw_tracker;

CREATE TABLE `qw_tracker` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `date` int(20) NOT NULL DEFAULT '0',
  `ip` varchar(32) NOT NULL DEFAULT '',
  `uagent` varchar(255) NOT NULL DEFAULT '',
  `page` varchar(255) NOT NULL DEFAULT '',
  `module` varchar(64) NOT NULL DEFAULT '',
  `full_page` varchar(64) NOT NULL DEFAULT '',
  `referer` varchar(64) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`),
  KEY `date` (`date`,`ip`,`page`),
  KEY `module` (`module`,`full_page`)
) ENGINE=MyISAM AUTO_INCREMENT=4622 DEFAULT CHARSET=utf8;




DROP TABLE qw_version;

CREATE TABLE `qw_version` (
  `VERSION_ID` int(11) NOT NULL,
  `VERSION_NAME` varchar(10) NOT NULL,
  `VERSION_INSTALLED` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=MyISAM DEFAULT CHARSET=utf8;




